import React from "react";
import useForm from "../lib/useForm";

function CreateProduct() {
	const { inputs, handleChange } = useForm();

	return (
		<form>
			<label htmlFor="name">name</label>
			<input
				type="text"
				id="name"
				name="name"
				placeholder="name"
				value={inputs.name}
				onChange={(e) => {
					handleChange;
				}}
			/>

			{/* <label htmlFor="name">price</label>
